def solve(values, length):
    count = 0
    for i in range(len(values)-length+1):
        if sum(values[i:i+length]) >= 0:
            count += 1
    return count

def solve(values, n):
    count = 0
    for i in range(len(values)-n+1):
        if all(sum(values[i:i+n]) >= 0 for j in range(n)):
            count += 1
    return count
